import React from "react";
import { Button } from "reactstrap";

function Home() {

    return (
        <div>
            <h1>Welcome to Worduel!</h1>
            <Button href="/wordle" color="primary">Classic Wordle</Button>
            <Button href="/worduel" color="primary">Worduel</Button>
        </div>
    )
}

export default Home;
